}

export class ListProduct extends Component {

  render() {
	  const {products}=this.props;
	  //const { classes } = props;
    return (
      <GridContainer>
      <GridItem xs={12} sm={12} md={12}>
        <Card>
          <CardHeader color="primary">
            <h4 className={classes.cardTitleWhite}>Simple Table</h4>
            <p className={classes.cardCategoryWhite}>
              Here is a subtitle for this table
            </p>
          </CardHeader>
          <CardBody>
            <Table
              tableHeaderColor="primary"
              tableHead={["Name", "Country", "City", "Salary"]}
              tableData={tableList.tabla}
            />
          </CardBody>
        </Card>
      </GridItem>
      <GridItem xs={12} sm={12} md={12}>
        <Card plain>
          <CardHeader plain color="primary">
            <h4 className={classes.cardTitleWhite}>
              Table on Plain Background
            </h4>
            <p className={classes.cardCategoryWhite}>
              Here is a subtitle for this table
            </p>
          </CardHeader>
          <CardBody>
            <Table
              tableHeaderColor="primary"
              tableHead={["ID", "Name", "Country", "City", "Salary"]}
              tableData={[
                ["1", "Dakota Rice", "$36,738", "Niger", "Oud-Turnhout"],
                ["2", "Minerva Hooper", "$23,789", "Curaçao", "Sinaai-Waas"],
                ["3", "Sage Rodriguez", "$56,142", "Netherlands", "Baileux"],
                [
                  "4",
                  "Philip Chaney",
                  "$38,735",
                  "Korea, South",
                  "Overland Park"
                ],
                [
                  "5",
                  "Doris Greene",
                  "$63,542",
                  "Malawi",
                  "Feldkirchen in Kärnten"
                ],
                ["6", "Mason Porter", "$78,615", "Chile", "Gloucester"]
              ]}
            />
          </CardBody>
        </Card>
      </GridItem>
    </GridContainer>
    );
  }
}

export default class ProductBox extends Component {
	url='http://localhost:85/produ3/web/app_dev.php/listadoJson/empresa';
	state={
		products:[]
	}
  componentDidMount() {
	  fetch(this.url)
			.then(response => response.json())
			/*.then(products => console.log(products))*/
			.then(products => this.setState({products}))
			.catch(e => console.log(e));
  }
  render() {
    return (
       <div className="row">
		<div className="col-md-6 my-3">
			<h1 className='font-weight-bold text-center'>Listado de Productos</h1>
			<ListProduct products = {this.state.products}/>
		</div>
		<div className="col-md-6 my-3">	
			<h1 className='font-weight-bold text-center'>Detalle de Productos</h1>		
			<FormProduct/>
		</div>	
      </div>
    );
  }
}
